import react from 'react';
import './App.css';

import Maps from './maps.js';

import Logo from './logo.js';
import LogoAdd from './logoAdd.js'

import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from 'react-router-dom';

function Frame(){

    return(
        <div>
        <Router>
        <div id="user">
          <Link to="/login">로그인</Link>
          <span>  </span>
          <Link to="/account">회원가입</Link>
        </div>
          <Routes>
            <Route path="/login" elemtent={<Maps/>}/>
            <Route path="/account" element={<Maps/>}/>
          </Routes>
        </Router>
        <div id="menu">
            <a href="./">
              <LogoAdd/>
            </a>
          <nav id ="mainNav">
            <ul className = "horizontal-list">
              <li><a href="/sogae.html">서비스 소개 <img src="menuVector.png"/> </a></li>
              <li><a href="/update.html">데이터 업로드 <img src="menuVector.png"/> </a></li>
              <li><a href="/community.html">커뮤니티 <img src="menuVector.png"/> </a></li>
            </ul>
          </nav>
        </div>
        </div>
    );
}


export default Frame;
